import React, {Component} from 'react'


class Profil extends Component{
  
    render(){
      return(
        <div className='card mt-5'>
          <div className='card-header'>
             <img src={this.props.coordonee.imgSrc} alt='logo'/>
          </div>
         <ul className=''>
            <li>{this.props.coordonee.fullName}</li>
            <li>{this.props.coordonee.bio}</li>
            <li>{this.props.coordonee.profession}</li>
         </ul>
         
        </div>
      )
      
    }
  }

export default Profil
